import React from 'react';
import { motion } from 'framer-motion';
import { FaRocket, FaCloud, FaShieldAlt, FaExpandArrowsAlt, FaBrain, FaCode } from 'react-icons/fa';
import { Link } from 'react-router-dom';

const FeatureCard = ({ icon: Icon, title, description }) => (
  <motion.div 
    className="bg-gray-800 bg-opacity-50 p-6 rounded-lg backdrop-filter backdrop-blur-sm"
    whileHover={{ y: -5, boxShadow: "0 10px 20px rgba(79, 70, 229, 0.2)" }}
  >
    <Icon className="text-indigo-400 w-8 h-8 mb-4" />
    <h3 className="text-xl font-semibold text-white mb-2">{title}</h3>
    <p className="text-gray-300 text-sm">{description}</p>
  </motion.div>
);

function Info2() {
  const features = [
    { icon: FaBrain, title: "AI Integration", description: "Seamlessly integrate AI into your workflows" },
    { icon: FaCloud, title: "Cloud Optimization", description: "Optimize your cloud infrastructure" },
    { icon: FaShieldAlt, title: "Secure Development", description: "Build with security at the forefront" },
    { icon: FaExpandArrowsAlt, title: "Scalable Architecture", description: "Design systems that grow with your business" },
    { icon: FaCode, title: "Smart Coding", description: "Intelligent code suggestions and auto-completion" },
    { icon: FaRocket, title: "Rapid Deployment", description: "Deploy your applications faster than ever" },
  ];

  return (
    <div className="min-h-screen bg-gradient-to-br from-gray-900 to-gray-800 text-white overflow-hidden py-20 px-4 sm:px-6 lg:px-8">
      <div className="max-w-7xl mx-auto">
        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center mb-16"
        >
          <h2 className="text-4xl tracking-tight font-extrabold sm:text-5xl md:text-6xl mb-6">
            <span className="block">Elevate Your</span>
            <span className="block text-indigo-400">Development Experience</span>
          </h2>
          <p className="mt-3 text-base text-gray-300 sm:text-lg md:mt-5 md:text-xl max-w-3xl mx-auto">
            Discover how TokTok's innovative solutions can transform your software development process and push the boundaries of what's possible.
          </p>
        </motion.div>

        <div className="grid grid-cols-1 md:grid-cols-2 lg:grid-cols-3 gap-8 mb-20">
          {features.map((feature, index) => (
            <motion.div
              key={index}
              initial={{ opacity: 0, y: 20 }}
              animate={{ opacity: 1, y: 0 }}
              transition={{ duration: 0.5, delay: index * 0.1 }}
            >
              <FeatureCard {...feature} />
            </motion.div>
          ))}
        </div>

        <motion.div
          initial={{ opacity: 0, y: 20 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="text-center"
        >
          <h3 className="text-3xl font-bold mb-6">Ready to Revolutionize Your Development?</h3>
          <p className="text-xl text-gray-300 mb-8 max-w-2xl mx-auto">
            Join thousands of visionaries who have accelerated their growth with TokTok's cutting-edge solutions.
          </p>
          <div className="flex justify-center space-x-4">
            <motion.div
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="rounded-md shadow"
            >
              <Link to="/get-started" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-white bg-indigo-600 hover:bg-indigo-700 md:py-4 md:text-lg md:px-10">
                Get Started
              </Link>
            </motion.div>
            <motion.div
              whileHover={{ scale: 1.05 }}
              whileTap={{ scale: 0.95 }}
              className="rounded-md shadow"
            >
              <Link to="/learn-more" className="w-full flex items-center justify-center px-8 py-3 border border-transparent text-base font-medium rounded-md text-indigo-600 bg-white hover:bg-gray-50 md:py-4 md:text-lg md:px-10">
                Learn More
              </Link>
            </motion.div>
          </div>
        </motion.div>
      </div>

      <motion.div
        initial={{ opacity: 0, y: 20 }}
        animate={{ opacity: 1, y: 0 }}
        transition={{ duration: 0.8, delay: 0.6 }}
        className="mt-20"
      >
        <div className="relative">
          <div className="absolute inset-0 flex items-center" aria-hidden="true">
            <div className="w-full border-t border-gray-700" />
          </div>
          <div className="relative flex justify-center">
            <span className="px-2 bg-gray-900 text-sm text-gray-400">
              Trusted by innovative teams worldwide
            </span>
          </div>
        </div>

        <div className="mt-8 grid grid-cols-2 gap-8 md:grid-cols-6 lg:grid-cols-5">
          {['Company A', 'Company B', 'Company C', 'Company D', 'Company E'].map((company, index) => (
            <div key={index} className="col-span-1 flex justify-center md:col-span-2 lg:col-span-1">
              <div className="text-gray-400 font-semibold">{company}</div>
            </div>
          ))}
        </div>
      </motion.div>
    </div>
  );
}

export default Info2;
